import Link from 'next/link'

class Isi extends React.Component(){
    constructor (props){
        super(props);
    }
    render(){
    return (
        <div class={props.div}>
        <li> <Link href= {props.link} ><a><span> {props.text} </span> <figure class={props.figure_class}><img src={props.img}/><figcaption class={props.figcaption_class}><span> <strong>{props.judul}</strong><br/> <br/>{props.starting} <br/><strong>{props.harga} </strong><br/><br/> {props.tanggal} <br/> {props.jam} <br/> {props.tempat}</span></figcaption></figure></a></Link> </li></div>
    )
}}

export default Isi;
